import React from 'react';
import logo from '../logo.svg';

const Header = () => {
    return (
        <div className="w-full relative p-4 py-2 bg-white dark:bg-gray-900 shadow-md z-10">
            <img className="w-32" src={logo} alt="logo" />
        </div>
    );
};

export default Header;
